using MeetingRoom.Models;
using MeetingRoom.Models.Data;
using MeetingRoom.Models.Domain;
using Microsoft.AspNetCore.Authorization;
using Microsoft.AspNetCore.Mvc;
using Microsoft.EntityFrameworkCore;

namespace MeetingRoom.Controllers
{
    public class RoomDetailsController : Controller
    {

        private readonly MeetingRoomDbContext meetingRoomDbContext;
        public RoomDetailsController(MeetingRoomDbContext meetingRoomDbContext)
        {
            this.meetingRoomDbContext = meetingRoomDbContext;
        }

        public async Task<IActionResult> Index()
        {
            var rooms = await meetingRoomDbContext.RoomDetailsDB.ToListAsync();
            foreach (var room in rooms)
            {
                room.ImageUrl ??=
                    "data:image/jpeg;base64,";
            }
            return View(rooms);
        }

        [HttpGet]
        public IActionResult AddRooms()
        {
            return View();
        }
        [HttpPost]
        public async Task<IActionResult> AddRooms(AddMeetingRoomModel addMeetingRoom)
        {
            var meetingRoom = new RoomDetailsDB()
            {
                Id = Guid.NewGuid(),
                RoomName = addMeetingRoom.RoomName,
                Location = addMeetingRoom.Location,
                Discription = addMeetingRoom.Discription,
                ImageUrl = addMeetingRoom.ImageUrl != null ? addMeetingRoom.ImageUrl : "data:image/jpeg;base64,"

            };

            await meetingRoomDbContext.RoomDetailsDB.AddAsync(meetingRoom);
            await meetingRoomDbContext.SaveChangesAsync();
            return RedirectToAction("Index");
        }


        [HttpGet]
        public async Task<IActionResult> ViewRooms()
        {
            var rooms = await meetingRoomDbContext.RoomDetailsDB.ToListAsync();
            foreach (var room in rooms)
            {
                room.ImageUrl ??=
                    "data:image/jpeg;base64,";
            }
            return View(rooms);
        }



        [HttpGet]
        public async Task<IActionResult> EditRoom(Guid id)
        {
            var room = await meetingRoomDbContext.RoomDetailsDB.FirstOrDefaultAsync(x => x.Id == id);
            if (room != null)
            {
                var viewModel = new AddMeetingRoomModel()
                {
                    Id = room.Id,
                    RoomName = room.RoomName,
                    Location = room.Location,
                    Discription = room.Discription,
                    ImageUrl = room.ImageUrl
                };
                return await Task.Run(() => View("EditRoom", viewModel));

            }
            return RedirectToAction("Index");

        }

        [HttpPost]
        public async Task<IActionResult> EditRoom(AddMeetingRoomModel model)
        {
            var room = await meetingRoomDbContext.RoomDetailsDB.FirstOrDefaultAsync(x => x.Id == model.Id);
            if (room != null)
            {
                room.Id = model.Id;
                room.RoomName = model.RoomName;
                room.Location = model.Location;
                room.Discription = model.Discription;
                room.ImageUrl = model.ImageUrl;

                await meetingRoomDbContext.SaveChangesAsync();
            }
            return RedirectToAction("Index");

        }

        [HttpPost]
        public async Task<IActionResult> DeleteRoom(Guid id)
        {
            var room = await meetingRoomDbContext.RoomDetailsDB.FirstOrDefaultAsync(x => x.Id == id);
            if (room != null)
            {
                meetingRoomDbContext.RoomDetailsDB.Remove(room);
                await meetingRoomDbContext.SaveChangesAsync();
            }
            return RedirectToAction("Index");

        }


    }
}
